import React, {useEffect, useState} from "react";
import {useSelector} from "react-redux";
import "./style.css";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faHome } from "@fortawesome/free-solid-svg-icons";

const ExtensionsList = (props) => {
    const devicesData = useSelector(state => state.devicesData);
    const loginData = useSelector(state => state.loginData);
    const [id, getId] = useState('')
    const checkOwnerId = (item) => {
        console.log("item", item)

        if (loginData.item !== undefined) {
            console.log("loginData.item[0].data.owner_id", loginData.item[0].data.owner_id)
            let id = loginData.item[0].data.owner_id;
            getId(id);
        }

    };
    useEffect(() => {
        checkOwnerId(devicesData.item)


    }, [loginData])
    return (
        <React.Fragment>
            <div className="container">

                <table className="table table-sm table-striped table-bordered table-hover">
                    <thead>
                    <tr>
                        <th>Extension</th>
                        <th>Device Name</th>
                        <th>Enabled</th>
                    </tr>
                    </thead>
                    <tbody>{
                        devicesData.item === undefined ? null : devicesData.item[0].map((item, i) => {

                            return (
                                item.owner_id === id ?

                                    <tr key={i}>
                                        <td>
                                            {item.username}
                                        </td>
                                        <td>
                                            {item.name}
                                        </td>
                                        <td >
                                            <i className="fa-power-off" ></i>
                                            <FontAwesomeIcon icon={faHome} />

                                        </td>
                                    </tr> : null
                            )

                        })
                    }</tbody>
                </table>
            </div>

        </React.Fragment>
    )
};


export default ExtensionsList;
